import React, { Fragment } from "react";
import Banner from "../layout/Banner"

import FlightSearchComponent from "../layout/FlightSearchComponent"

const FlightPage = () => {
  return (
    <Fragment> 
    <div className="home">
    <Banner imageurl={"url(https://images.unsplash.com/flagged/photo-1576480546898-2455d2189100?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60)"} backgroundPos ={"center center"} />

    <FlightSearchComponent/>

    </div>
    </Fragment>
  );
};

export default FlightPage;
